// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awLayoutSlotIncludeRenderFunction } from 'js/AwLayoutSlotIncludeService';


/*
ctx imports
*/
import { getApplicableActiveSlots as activeSlot } from 'js/AwLayoutSlotIncludeService';
const ctxImportObj = { activeSlot };


/*
dynamic import
 */
registerDynImportEntry('js/AwLayoutSlotIncludeService', () => import('js/AwLayoutSlotIncludeService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awLayoutSlotIncludeRenderFunction",
            "deps": "js/AwLayoutSlotIncludeService"
        }
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "name": {
            "type": "string"
        },
        "context": {
            "type": "object"
        }
    },
    "ctx": {
        "activeSlot": {
            "parser": {
                "method": "getApplicableActiveSlots",
                "deps": "js/AwLayoutSlotIncludeService"
            }
        }
    },
    "_viewModelId": "AwLayoutSlotInclude",
    "_uniqueViewModelId": "AwLayoutSlotInclude"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awLayoutSlotIncludeRenderFunction, undefined, ctxImportObj );

export default Component;
